import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './App.css';



export const Main = () => {
    const navigate = useNavigate();
    return (
        <div id="maindiv">
            <div>Welcome to Yash's Calculator</div>
            <div>What would u like to do?</div>
            <div id="maincan">
                <button onClick={() => navigate('/sum')}> ADD  </button>
                <button onClick={() => navigate('/diff')}> SUB  </button>
                <button onClick={() => navigate('/mul')}> MUL  </button>
                <button onClick={() => navigate('/div')}> DIV  </button>
            </div>
        </div>
    );
}
